   // Parameters Bit width : 12
   //
   // Variable name: cross_channel_process_en.
   // Configuration parameters of ABF3.
   // Default value: 1.
   // Data range: 0 or 1
   // Effect: Enable cross-channel processing for Gr/GB channels
   //
   // Variable name: distance_ker[2][3].
   // Pixel distance from center to calculate bilateral filter coefficients, distance_ker[0][] - R/B, distance_ker[1][] - Gr/Gb
   // Default value: {3, 2, 1, 3, 2, 1}.
   // Data range: [][0]  center pixel, range 1-4; [][1]  near surrounding pixels, range 0-2; [][2]  far surrounding pixels, range 0-1
   // Effect:
   //
   // Variable name: bpc_fmax, bpc_min
   // Parameters for adjusting thresholds for single bpc
   // Default value: 8,8
   // Data range: 6uQ6, 1-63 for bpc_fmax, 0-63 for bpc_min
   // Effect: increase value will increase threshold, less bad pixels get detected/corrected
   //
   // Variable name: bpc_maxshft, bpc_minshft
   // Parameters for adjusting thresholds for neighbouring hot/cold pixel detection
   // Default value: 4, 4
   // Data range: 0-14
   // Effect: increase value will reduce  threshold, more bad pixels get detected
   //
   // Variable name: bpc_offset
