   // Default value: 0, 0 for normal/bright lights, 4,4 for ultra-low light
   // Data range: 0-4
   // Effect:
   //
   // Variable name: noise_std_lut_level[ABFV34_NOISESTD_LENGTH+1]
   // 65-entry noise profile, stores in terms of std dev. Combined with edge_softness and divided by (1<<13) to form final noise table
   // Default value: { 3, 12, 16, 20, 22, 25, 27, 30, 32, 33, 35, 37, 38, 40, 41, 43,
