   // Feature name: Bad Pixel Correction 2 (Defect Pixel Correction).
   // Applicable chipset(s): HW version 8996 or later.
   // Applicable operation mode: Preview, camcorder record and snapshot.
   //
   // Control Parameters
   //
   // Variable name: bpc2_hysteresis_trigger.
   // Hysteresis trigger to control BPC2 enable flag, when BPC2_en set to 1,
   //   if trigger is > trigger_end, then BPC2 will be enabled and if (trigger_start < trigger < trigger_end),
   //   enable flag decided based on trigger in upward direction (disabled) or in downward direction (enabled).
   //   Notes: Default setting to disable BPC2 for video recording, recommendation to set hysteresis trigger equal to 4th region
   //   wavelet trigger (~50lux). To completely disable BPC2, push the
   //   hysteresis trigger to larger values (100, 200, 1000, 2000) i.e. larger than max_gain and max_lux_idx.
   //   To enable BPC2 module always, program hysteresis trigger to (0.8, 0,9, 80,90) i.e. smaller than min_gain and min_lux_idx.
   //   For Snapshot , hysteresis depends on snapshot_hyst_en_flag. If flag is set to 0, hysteresis is disabled
   //   (i.e. BPC2 enabled).
   // Default value: For Video {4th_rgn_gain_start,4th_rgn_gain_end,4th_rgn_lux_start,4th_rgn_lux_end} (calculated),
   //                For snapshot {0.8,0.9,80,90}.
   //
   // Variable name: bpc2_snapshot_hyst_en_flag.
   // Flag to enable or disable BPC2 hysteresis for snapshot use cases.
   //   This flag will be ignored for video or streaming/continuous mode operation.
   //   Default setting of this flag to 0 i.e. disable hysteresis, hence BPC2 Enabled.
   //   If flag set to 1, hysteresis will be enabled, BPC2 enable flag will be decided based on trigger changes.
   // Default value: 0 (for snapshot, video live shot use cases),
   //                ignored for all other use cases.
   //
