   //
   // Variable name: cold_pixel_correction_disable.
   // Enables and disables Cold pixel Detection and Correction.
   // Default value: 0.
   // Data range: 0 to 1 (1u)
   // Constraints: None.
   // Effect: 0 disables the feature, 1 enables the feature.
   //
   // Variable name: highlight_detection_param1.
