   // Constraint: Sum of three params (highlight_detection_param1/2/3) should be positive value and
   //   default value is 10
   // Effect: A smaller value means that fewer pixels will be reset as "highlight pixel"
   //   after correction. A larger value means that more pixels will be reset as "highlight
   //   pixel" after correction.
