   //   will be detected as Single Bad pixels, so some real single bad pixels may be missed.
   //   For Non-HDR: Chromatix parameter is for HDR mode. Software will multiply Chromatix value by 4 for Non HDR.
   //
   // Variable name: BCC_offset.
