   // Default value:  NZ_HV[0] = NZ_HV[1] = NZ_HV[2] = 1 / NZ_HV[4] = NZ_HV[5] = NZ_HV[6] = -1 / NZ_HV[3] = NZ_HV[7] = 0
   // Data range: -1 to 1.
   // Constraints: Each Item Value are selected from [-1 0 1].
   // Effect:
   //
   // Variable name: NZ_D[8].
   // Control Sign of Diagonal Coefficients
   //   (corresponds to NZ[8] used in Diagonal Edge Detection  in HW Design).
   // Default value:  NZ_D[0] = NZ_D[1] = NZ_D[2] = 1 / NZ_D[4] = NZ_D[5] = NZ_D[6] = -1 / NZ_D[3] = NZ_D[7] = 0
   // Data range: -1 to 1.
   // Constraints: Each Item Value are selected from [-1 0 1]
   // Effect:
   //
   // Variable name: Fx[9].
   // Edge Detection Filter Coefficient
   //   (corresponds to Fx in HW Design).
   // Default value:  Sobel Filter Fx[0] = Fx[1] = Fx[2] = Fx[3] = Fx[6] = Fx[7] = Fx[8] = 0 / Fx[4] = 1 Fx[5] = 2
   // Data range: Fx[0]/Fx[1]/Fx[3]/Fx[4]: -15 to 15;  Fx[2]/Fx[5]/Fx[6]/Fx[7]: -31 to 31;  Fx[8]: -63 to 63.
   // Constraints:
   // Effect:
   //
   // Variable name: ThSaturation.
   // Threshold value to control if a pixel is beside a Saturation Region
   //   (corresponds to ThSaturation in HW design).
   // Default value:  2000.
   // Data range: 0 to 4095.
   // Constraints:
   // Effect: If the values is smaller, more pixels will be detected beside saturation region,
   //         meaning that more pixels may be set as CAC pixel and be processed.
   //
   // Variable name: ThEdge.
   // Threshold value to control if a pixel is an edge pixel
   //   (corresponds to ThEdge in HW design).
   // Default value: 320.
   // Data range: 0 to (2^17-1) if enabled. Negative value to disable.
   // Constraints:
   // Effect: For positive values, if the value is smaller more pixels will be detected as edge,
   //         meaning that more pixels may be set as CAC pixel and be processed.
   //         Set a negative value to diable the feature in software.
   //
   // Variable name: PossibleCAPixelRGHighThreshold (HW 19uQ7)
   // Threshold value to control the maximal possible Chroma1 value that a chromatic aberration pixel may have.
   //   The pixels with Chroma1 value larger than the Threshold cannot be 'chromatic aberration pixel'
   //   (corresponds to UpThrRG in HW design).
   // Default value:  2.0
